import React from 'react';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route path='/' element={<Home />} />
          {/* 다른 경로에 대한 Route 설정 */}
        </Routes>
      </Router>
    </>
  );
}

export default App;
